import React from "react";


class ArticlePage extends React.Component  {



  componentDidMount(){
    const article_id = this.props.match.params.article_id ;
  };

  render(){
    return (

      <React.Fragment>
        <h1>Blog page </h1>



        <h1>{article_id}</h1>

      </React.Fragment>
    );
  }
}

export default ArticlePage;
